import React from 'react';
import { Row, Col, Icon, Card, CardTitle, Table } from 'react-materialize';
function Home(props) {
  if (this.props.user.trim() == "")
    return (
      <Row>
        <Col
          m={6}
          s={6}
        >
          <Card
            actions={[
              <a key="1" href="#">Sing up</a>
            ]}
            closeIcon={<Icon>close</Icon>}
            header={<CardTitle image="https://ideas.staticsfly.com/ideas/wp-content/uploads/2018/10/you-got-this-list-1.jpg">Well To Do</CardTitle>}
            revealIcon={<Icon>more_vert</Icon>}
          >
            Organize your tasks never miss deadline!!.
    </Card>
        </Col>
      </Row>

    );
  else {
    return (
      <Collapsible
  accordion
  popout
>
  <CollapsibleItem
    expanded={false}
    header="Better safe than sorry. That's my motto."
    icon={<Icon>checkbox</Icon>}
    node="div"
  >
    Clean the Bathroom
  </CollapsibleItem>
  <CollapsibleItem
    expanded={false}
    header="Yeah, you do seem to have a little 'shit creek' action going."
    icon={<Icon>checkbox</Icon>}
    node="div"
  >
    Do your Homework.
  </CollapsibleItem>
  <CollapsibleItem
    expanded={false}
    header="You know, FYI, you can buy a paddle. Did you not plan for this contingency?"
    icon={<Icon>checkbox</Icon>}
    node="div"
  >
    Eat your dinner.
  </CollapsibleItem>
</Collapsible>

    );
  }
}

export default Home;
